import React from 'react';
import { useNavigate } from 'react-router-dom';
import { User, Mail, Lock } from 'lucide-react';

const Register = () => {
  const navigate = useNavigate();

  return (
    <div className="auth-container">
      <div className="header">
        <h1 style={{ fontFamily: 'serif', letterSpacing: '4px' }}>TRELLIS</h1>
        <h3 style={{ fontWeight: 400, opacity: 0.8 }}>Start Your Journey</h3>
      </div>

      <form style={{ marginTop: '2rem' }}>
        <div className="input-box">
          <User size={18} color="#9d50bb" />
          <input type="text" placeholder="Full Name" className="input-field" required />
        </div>

        <div className="input-box">
          <Mail size={18} color="#9d50bb" />
          <input type="email" placeholder="College Email" className="input-field" required />
        </div>
        
        <div className="input-box">
          <Lock size={18} color="#9d50bb" />
          <input type="password" placeholder="Create Password" className="input-field" required />
        </div>

        <button type="submit" className="action-btn">CREATE ACCOUNT</button>
      </form>

      <p style={{ marginTop: '1.5rem', fontSize: '0.9rem', opacity: 0.7 }}>
        Already a member? 
        <span onClick={() => navigate('/')} style={{ color: '#9d50bb', cursor: 'pointer', marginLeft: '5px', fontWeight: 'bold' }}>
          Login Here
        </span>
      </p>
    </div>
  );
};

export default Register;
